import BreadCollection from '../components/CollectionsOfRecipes/BreadCollection';
import Footer from '../components/Footer/Footer';

function About() {
    return (
        <div>
            <Navbar />
            <h1><Text t="about-us" /></h1>
            <h3>Banner</h3>
            <h4>My photo</h4>
            <p>Some text about me and why I do this.</p>
            <FavoriteRecipes />
            <BreadCollection />
        </div>
    );
}

export default About;
